import { BrowserRouter, Route, Routes } from 'react-router-dom';
import React,{ useState } from 'react';
import './App.css';
import Home from './components/Home';
import NavBar from './components/NavBar';
import SpartanAbode from '../src/components/SpartanAbode';
import Testimonials from './components/Testimonials';

function App() {
  const [isDarkMode, setisDarkMode] = useState('black');
  return (
    <div style={{backgroundColor:`${isDarkMode}`,color:'white',minHeight: '100vh'}}>
    <NavBar name="Vinayak Santhosh"/>
    <BrowserRouter>
        <Routes>
          <Route path='/' element={<Home/>}></Route>
          <Route path='/about' element={<SpartanAbode/>}></Route>
          <Route path='/testimonial' element={<Testimonials/>}></Route>
        </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
